INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('76', '3', 'ציטוטים', '&lt;p style=&quot;direction: rtl; &quot;&gt;&lt;font face=&quot;Arial&quot;&gt;מבחר גדול של ציטוטים בחנות המקוונת לאמנות הקיר שלנו. בחר את הגודל שלך ואחד מ- 35 הצבעים החיים שלנו. שלב עם זוהר באלמנטים הכהים, פרפרי תלת מימד ועוד!&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'ציטוטים', '', '');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('61', '3', 'חיות', '&lt;p style=&quot;direction: rtl; &quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;מבחר בעלי חיים נפלא לקיר שלכם! בחר מבין הקטגוריות הרבות כמו פרפרים, ינשופים, חיות מחמד, סוסים, טורפים או חיי ים.&lt;/span&gt;&lt;/font&gt;&lt;br&gt;&lt;/p&gt;', 'חיות', 'חיות, בעלי חיים, ציפורים, כלבים, חתולים, פרפרים', 'חיות, בעלי חיים, ציפורים, כלבים, חתולים, פרפרים');
INSERT INTO `oc_category_description` (`category_id`, `language_id`, `name`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('70', '3', 'חדר תינוקות', '&lt;p style=&quot;direction: rtl; &quot;&gt;מדבקות קיר לחדר תינוקות הן למעשה פתרון העיצוב האידאלי לחדרם של הקטנטנים שלנו. השראת אווירה מלאת חיים בחדר התינוקות הינה מלאכה מאוד פשוטה וכיפית לביצוע כאשר משתמשים במדבקות קיר לחדר תינוקות. מדבקות הקיר עבור התינוקות שלנו הינם עולם ומלואו שכולו מלא דמיון וחיים, כאילו נלקח מעולם האגדות.&lt;/p&gt;&lt;p style=&quot;direction: rtl; &quot;&gt;מדבקות קיר לחדר תינוקות רצוי שיהיו עדינות בשילוב דמויות מעולם החי והצומח ובעלות גוונים צבעוניים.&lt;/p&gt;&lt;p style=&quot;direction: rtl; &quot;&gt;היתרון בשימוש במדבקות הקיר לחדר תינוקות כאובייקט עיצובי והשראתי הינו מאוד מושכל, כוון שלמדבקות הקיר יכולת למלא את חדר הילדים באווירה מקסימה ומלאת חיים בעלות סבירה מאוד ולא מוגזמת. התוצאה המתקבלת מעיצוב חדר תינוקות באמצעות מדבקות קיר היא תוצאה של שינוי חלל החדר ב-180 מעלות והפיכתו לחדר מלא אווירה נפלאה, מעשירה ומיוחדת.&lt;/p&gt;&lt;p style=&quot;direction: rtl; &quot;&gt;בל נשכח כי הפעוט מביט כל העת על מדבקת הקיר וככל שיהיו בה פרטים שיעניינו אותו כך הוא ישקיע זמן רב יותר בלהביט בה.&lt;/p&gt;&lt;p style=&quot;direction: rtl; &quot;&gt;מדבקות קיר לתינוק עשויות מחומר ויניל איכותי ידידותי לסביבה. הן ניתנות להדבקה והסרה בקלות ואינן פוגעות בקיר.&lt;/p&gt;&lt;p style=&quot;direction: rtl; &quot;&gt;מדבקות קיר לחדר תינוקות יכולות להכיל מגוון רב של דמויות ומכאן גם יתרונן, כוון שכך למעשה מביאים את עולם הדמיון בצורה קלה ופשוטה לחדרו של הילד וגורמים לו לגירוי הדמיון והעשרתו.&lt;/p&gt;&lt;p style=&quot;direction: rtl; &quot;&gt;מדבקות קיר לתינוקות קיימות במספר עיצובים וגדלים ובבואנו לבחור מדבקת קיר נבחין האם זו מדבקת קיר לחדר של תינוק או מדבקת קיר לחדר של תינוקת והאם הדמויות במדבקת הקיר מתאימות לעולם התוכן של התינוק שאנו רוצים לחשוף אותו.&lt;/p&gt;&lt;p style=&quot;direction: rtl; &quot;&gt;ככלל, כל מדבקות הקיר לחדר התינוקות הנן מדבקות איכותיות, תואמות לעולמם של הפעוטות, מגרות את הדמיון והרצון להתבונן בפרטים הקטנים ובעיקר משרות אווירה מקסימה ומלאת חיים בחדר.&lt;/p&gt;', 'חדר תינוקות', '', '');
