INSERT INTO `oc_information_description` (`information_id`, `language_id`, `title`, `description`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('4', '3', 'About Us', '&lt;p&gt;Stickers-Center is an online shopping website selling quality wall-stickers at a fair price. &lt;/p&gt;&lt;p&gt;The owner of the business, Dvir Elimelech, is engaging in the flag of the business about the fairness of the price to the customer as well as the supply of good and high quality wall stickers that meet high standards of design and made of high quality materials. &lt;/p&gt;&lt;p&gt;Our love for wall stickers began a long time ago when we first had to decorate our own home, while we were searching for a comfortable yet&amp;nbsp; satisfying solution.&lt;/p&gt;&lt;p&gt;We soon realized that each room at our house looks and feel so much better if we add it a couple of wall stickers.&amp;nbsp;&lt;/p&gt;&lt;p&gt;This choice was such a success for us that we knew that we had to share this with more people.&amp;nbsp;&lt;/p&gt;&lt;p&gt;&lt;br&gt;&lt;/p&gt;&lt;p&gt;And here we are, 7 years later, serving hundreds of customers all over the world, helping you to make your living spaces look as you wish at an affordable cost.&lt;/p&gt;\r\n', 'About Us', 'about us, wall stickers shop, wall stickers store, wallpaper, wallpapers, wall decor, 3d wall stickers, kids room wall stickers', 'about us, wall stickers shop, wall stickers store, wallpaper, wallpapers, wall decor, 3d wall stickers, kids room wall stickers');
