INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES ('84', '1', 'Beautiful Lily Magnolia Flowers', '&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Size: 1x 60*90cm, 1x 15*20cm&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Material: PVC&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Decorate baby and kids nursery, interior walls or windows of home, bathroom, office, dorm, or store&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;span class=&quot;a-list-item&quot; style=&quot;font-size: 14px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;Easy to apply, remove, reposition, and reuse without leaving damage or residue&lt;/font&gt;&lt;/span&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;The decals assemble easily, just like a puzzle, and each of the pre-cut elements can be moved around at any time without damage. Because they never leave behind any sticky residue. This wall decals can be easily repositioned as often as you like without any damage to your walls.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Steps:&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1.Open the wall sticker and smooth it out. Cut the wall sticker into small pieces after pressing for more than twenty-four hours.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2.Choose the place where you want to paste. Then, clean the surface of the wall.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3.Sample images are only for your reference(also you can DIY). Peel the stickers off along the cutting line. Then, you can paste them on the places you prefer.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;4.Tips and steps for Installing the larger the wall sticker. First, peel off partial wall sticker carefully, and fold the backing paper in two. The next step is to paste the peeled part of the wall sticker on the region you prefer. The last step is to smooth the wall sticker with one hand, at the same time, peel off the backing paper of the wall sticker with another hand.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;5.You can bring your creativity into play, though the way of putting the stickers that you disign together. In another way, different stickers can be combined.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;6.About four weeks later after installation, you should better press the wall stickers again.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;br&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Note:&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;1. Don\'t stick to the wall which are peeling or dropping ash.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;2. Don\'t stick to any surface of the potholes.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;3. Don\'t stick to uneven wallpaper.&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;&lt;br&gt;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Features:&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;100% brand new and high quality&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Removable Wall Sticker&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Environmental friendly&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Decorate your room, an ideal way to personalise your home in a very affordable way&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Can be applied to any smooth and clean surface such as wall, door, window, plastic, metal, ceramic tile, etc&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;NOT suitable for dirty or rough surface&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Material: PVC&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Size: before posting approx. 60*90CM&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;/p&gt;&lt;p style=&quot;list-style: disc; overflow-wrap: break-word; margin-bottom: 0px;&quot;&gt;&lt;font face=&quot;Arial&quot;&gt;&lt;span style=&quot;font-size: 14px;&quot;&gt;Finished size: approx. 70*150CM&amp;nbsp;&lt;/span&gt;&lt;/font&gt;&lt;/p&gt;', '', 'Beautiful Lily Magnolia Flowers', '', '');
